import Foundation
@testable import ZcashLightClientKit

enum FakeChainBuilderError: Error {
    case fakeHexDataConversionFailed
}
class FakeChainBuilder {
    
    static let txUrl = "https://raw.githubusercontent.com/zcash-hackworks/darksidewalletd-test-data/master/transactions/tx-8f064d23.txt"
    static func buildChain(darksideWallet: DarksideWalletService) throws {
        try darksideWallet.reset(saplingActivation: 663150)
        try darksideWallet.useDataset(DarksideDataset.beforeReOrg.rawValue, startHeight: 663150)
       
        try darksideWallet.stageBlocksCreate(from: 663174, count: 15)
//        try darksideWallet.stageTransaction(from: txUrl, at: 663174)
        try darksideWallet.stageTransaction(rawTransaction(at: 663174, base64Data: txData[663174]!), at: 663174)
        try darksideWallet.stageTransaction(rawTransaction(at: 663188, base64Data: txData[663188]!), at: 663188)
      //  try darksideWallet.applyStaged(nextLatestHeight: 663188)
        
    }
    
    static func rawTransaction(at height: Int, base64Data: String) throws -> RawTransaction {
        guard let hexData = Data(base64Encoded: base64Data) else {
            throw FakeChainBuilderError.fakeHexDataConversionFailed
        }
        var tx = RawTransaction()
        tx.height = UInt64(height)
        tx.data = hexData

        return tx
    }
    static let txData = [ 663174 :
    ""
//        ""
        ,
                          
      663188 :
    ""
//        ""
    ]
}
